import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        double c1x = scanner.nextDouble();
        double c1y = scanner.nextDouble();
        double c1r = scanner.nextDouble();
        double c2x = scanner.nextDouble();
        double c2y = scanner.nextDouble();
        double c2r = scanner.nextDouble();

        double dx = c2x - c1x;
        double dy = c2y - c1y;
        double d = Math.sqrt(dx * dx + dy * dy);
        double a = (c1r * c1r - c2r * c2r + d * d) / (2 * d);
        double h = Math.sqrt(c1r * c1r - a * a);
        double xm = c1x + a * dx / d;
        double ym = c1y + a * dy / d;
        double xs1 = xm + h * dy / d;
        double xs2 = xm - h * dy / d;
        double ys1 = ym - h * dx / d;
        double ys2 = ym + h * dx / d;

        System.out.printf("%.5f %.5f%n", xs1, ys1);
        System.out.printf("%.5f %.5f%n", xs2, ys2);
        if (c1r * c1r == c2r * c2r + d * d) {
            System.out.printf("%.5f %.5f%n", c2x, c2y);
        }
    }
}
